import React from 'react';
import { Button } from 'react-bootstrap';
import './button.scss';

const MainButton = ({ onClick }) => {
    return (
        <div>
            <Button variant="info" onClick={onClick} className='mainButton'>Add item</Button>{' '}
        </div>
    )
}

export default MainButton;
